import React from "react";
import "../../styles/Experience.scss";
import ExperienceCard from "../components/ExperienceCard"; 
import SkillCard from "../components/SkillCard";
import { Fade } from "react-reveal";
import Navbar from "../components/Header";

const Experience = () => {
    return (
      <React.Fragment>
        <Navbar />
        <div className="background">
          <div className="experience">
            <button className="back-to-top">BACK</button>
            <h1 className="experience-title">Experience</h1>
            <Fade bottom cascade>
              <div className="cards">
                <ExperienceCard
                  header="IT"
                  name="IT Intern"
                  caption="Resolved IT issues for Commonwealth employees."
                  company="Office of the Governor"
                  year="2018 Summer"
                  //link="https://"
                />
                <ExperienceCard
                  header="SD"
                  name="Service Desk Technician"
                  caption="Provided high level customer service to end users."
                  company="Armstrong World Industries"
                  year="Dec. 2020 - July 2021"
                  //link="https://"
                />

                <ExperienceCard
                  header="BP"
                  name="Business Process Specialist"
                  caption="SAP Security"
                  company="Armstrong World Industries"
                  year="July 2021 - Present"
                  // link="https://"
                />
                
              </div>
            </Fade>
          </div>

          <div className="skills">
            <h1 className="skill-title">Skills</h1>
            <Fade bottom cascade>
              <div className="skill-cards">
                <SkillCard
                  header="SQL"
                  name="MySQL"
                  //caption="Resolved IT issues for Commonwealth employees."
                  //company="Office of the Governor"
                  //year="2018"
                  //link="https://"
                />
                <SkillCard
                  header="PHP"
                  name="Hypertext Preprocessor"
                  //caption="Provided high level customer service to end users."
                  //company="Armstrong World Industries"
                  //year="Dec. 2020 - July 2021"
                  //link="https://"
                />

                <SkillCard
                  header="SAP"
                  name="Systems, Applications & Products in Data Processing"
                  //caption="SAP Security"
                  //company="Armstrong World Industries"
                  //year="July 2021 - Present"
                  // link="https://"
                />
                <SkillCard
                  header="HTML"
                  name="HyperText Markup Language"
                  // caption=""
                  // company=""
                  // year=""
                />

                <SkillCard
                  header="CSS"
                  name="Cascading Style Sheets"
                  // caption=""
                  // company=""
                  // year=""
                  // link=""
                />

                <SkillCard
                  header="Excel"
                  name="Microsoft"
                  // caption=""
                  // company=""
                  // year=""
                  // link=""
                />

                <SkillCard
                  header="Word"
                  name="Microsoft"
                  // caption=""
                  // company=""
                  // year=""
                  // link=""
                />

                <SkillCard
                  header="PPT"
                  name="Microsoft"
                  // caption=""
                  // company=""
                  // year=""
                  // link=""
                />

                <SkillCard
                  header="Java"
                  name="Microsoft"
                  // caption=""
                  // company=""
                  // year=""
                  // link=""
                />

                <SkillCard
                  header="Python"
                  name="Microsoft"
                  // caption=""
                  // company=""
                  // year=""
                  // link=""
                />
              </div>
            </Fade>
          </div>
        </div>
      </React.Fragment>
    );
  };
  
  export default Experience;
